v_pe_fourth_year,v_pe_fifth_year,v_pat_first_year,v_pat_second_year,v_pat_third_year,v_pat_fourth_year,v_pat_fifth_year,v_b_weight from opportunity_summary_data where  opp_master = old.opp_mas_id;

if (new.market_cap  <> old.market_cap) then

set v_calc_m_cap = new.market_cap;
set v_calc_pe_first_year = (v_calc_m_cap/v_pat_first_year);
set v_calc_pe_second_year = (v_calc_m_cap/v_pat_second_year);
set v_calc_pe_third_year = (v_calc_m_cap/v_pat_third_year);
set v_calc_pe_fourth_year = (v_calc_m_cap/v_pat_fourth_year);
set v_calc_pe_fifth_year = (v_calc_m_cap/v_pat_fifth_year);
set v_calc_peg_oj = (v_calc_pe_third_year/v_pat_growth_third);
set v_calc_weight = v_b_weight;
set v_calc_port_pe_first = ((v_calc_weight*v_calc_pe_first_year)/100.0);
set v_calc_port_pe_second = ((v_calc_weight*v_calc_pe_second_year)/100.0);
set v_calc_port_pe_third = ((v_calc_weight*v_calc_pe_third_year)/100.0);
set v_calc_port_pe_fourth = ((v_calc_weight*v_calc_pe_fourth_year)/100.0);
set v_calc_port_pe_fifth = ((v_calc_weight*v_calc_pe_fifth_year)/100.0);
set v_calc_peg_year_peg = ((v_calc_weight*v_calc_peg_oj)/100.0);
set v_calc_wt_avg_cap = ((v_calc_weight*v_calc_m_cap)/100.0);

update opportunity_summary_data set m_cap = v_calc_m_cap,pe_first_year = v_calc_pe_first_year,
pe_second_year = v_calc_pe_second_year,pe_third_year = v_calc_pe_third_year,
pe_fourth_year = v_calc_pe_fourth_year,pe_fifth_year = v_calc_pe_fifth_year,
peg_oj = v_calc_peg_oj,port_pe_first = v_calc_port_pe_first,port_pe_second = v_calc_port_pe_second,
port_pe_third = v_calc_port_pe_third,port_pe_fourth = v_calc_port_pe_fourth,port_pe_fifth = v_calc_port_pe_fifth,
peg_year_peg = v_calc_peg_year_peg,wt_avg_cap = v_calc_wt_avg_cap
 where opp_master = old.opp_mas_id;
 
end if;

if(new.prev_close <>old.prev_close)then
update financial_summary set cmp=new.prev_close where opp_master_id = old.opp_mas_id;
update non_financial_summary set cmp=new.prev_close where opp_mas_id = old.opp_mas_id;
update opportunity_summary_data set cmp=new.prev_close where opp_master = old.opp_mas_id;
end if;

end
